import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap-icons/font/bootstrap-icons.css";
import "bootstrap/js/dist/dropdown"; // Ensure Bootstrap JavaScript is loaded

function SidebarMenu() {
  const [isExpanded, setIsExpanded] = useState(true);

  return (
    <div className="container-fluid">
      <div className="row">
        {/* Sidebar */}
        <div
          className={`bg-dark text-white d-flex flex-column justify-content-between min-vh-100 p-3 ${
            isExpanded ? "col-auto col-sm-2" : "col-auto col-sm-1 text-center"
          }`}
          style={{ transition: "width 0.3s" }} // Smooth transition effect
        >
          {/* Toggle Button */}
          <button
            className="btn text-white mb-3"
            onClick={() => setIsExpanded(!isExpanded)}
          >
            <i
              className={`bi ${
                isExpanded ? "bi-chevron-left" : "bi-list"
              } fs-3`}
            ></i>
          </button>

          {/* Sidebar Links */}
          <ul className="nav flex-column">
            <li className="nav-item">
              <a
                className="nav-link text-white d-flex align-items-center"
                href="#"
              >
                <i className="bi bi-speedometer2 fs-5"></i>
                {isExpanded && <span className="ms-2">Dashboard</span>}
              </a>
            </li>
            <li className="nav-item">
              <a
                className="nav-link text-white d-flex align-items-center"
                href="#"
              >
                <i className="bi bi-person fs-5"></i>
                {isExpanded && <span className="ms-2">Profile</span>}
              </a>
            </li>
            <li className="nav-item">
              <a
                className="nav-link text-white d-flex align-items-center"
                href="#"
              >
                <i className="bi bi-gear fs-5"></i>
                {isExpanded && <span className="ms-2">Settings</span>}
              </a>
            </li>
            <li className="nav-item">
              <a
                className="nav-link text-white d-flex align-items-center"
                href="#"
              >
                <i className="bi bi-box-arrow-right fs-5"></i>
                {isExpanded && <span className="ms-2">Logout</span>}
              </a>
            </li>
          </ul>

          {/* Dropdown User Profile */}
          <div className="dropdown open">
            <a
              className="btn border-none dropdown-toggle text-white d-flex align-items-center"
              type="button"
              id="triggerId"
              data-bs-toggle="dropdown"
              aria-haspopup="true"
              aria-expanded="false"
            >
              <i className="bi bi-person fs-4"></i>
              {isExpanded && <span className="fs-5 ms-2">Yousaf</span>}
            </a>
            <div className="dropdown-menu" aria-labelledby="triggerId">
              <a className="dropdown-item" href="#">
                {" "}
                Profile{" "}
              </a>
              <a className="dropdown-item" href="#">
                {" "}
                Settings{" "}
              </a>
              <a className="dropdown-item" href="#">
                {" "}
                Logout{" "}
              </a>
            </div>
          </div>
        </div>

        {/* Main Content */}
        <div className="col">
          <h2 className="mt-3">Admin Dashboard</h2>
        </div>
      </div>
    </div>
  );
}

export default SidebarMenu;
